        firstDate = this.startOfWeek(firstDate);
        days.push(firstDate);
        for (let i = 0; i < 41; i++) { // 41 = 6*7 -1 to get 6 weeks
            const day = new Date(new Date(firstDate.getTime()).setHours(0, 0, 0, 0));
            days.push(this.addDays(day, 1 + i));
        }
